    @objc dynamic public class func drawOuterRing(frame targetFrame: NSRect = NSRect(x: 0, y: 0, width: 118, height: 122), resizing: ResizingBehavior = .aspectFit) {
        //// General Declarations
        let context = NSGraphicsContext.current!.cgContext
        
        //// Resize to Target Frame
        NSGraphicsContext.saveGraphicsState()
        let resizedFrame: NSRect = resizing.apply(rect: NSRect(x: 0, y: 0, width: 118, height: 122), target: targetFrame)
        context.translateBy(x: resizedFrame.minX, y: resizedFrame.minY)
        context.scaleBy(x: resizedFrame.width / 118, y: resizedFrame.height / 122)
        let resizedShadowScale: CGFloat = min(resizedFrame.width / 118, resizedFrame.height / 122)


        //// Color Declarations
        let shadowColor = NSColor(red: 0.293, green: 0.328, blue: 0.38, alpha: 1)

        //// Shadow Declarations
        let shadow = NSShadow()
        shadow.shadowColor = shadowColor.withAlphaComponent(0.73 * shadowColor.alphaComponent)
        shadow.shadowOffset = NSSize(width: 1, height: -1)
        shadow.shadowBlurRadius = 4.5

        //// outline Drawing
        let outlinePath = NSBezierPath()
        outlinePath.move(to: NSPoint(x: 57, y: 109.25))
        outlinePath.line(to: NSPoint(x: 102.03, y: 83.25))
        outlinePath.line(to: NSPoint(x: 102.03, y: 31.25))
        outlinePath.line(to: NSPoint(x: 57, y: 5.25))
        outlinePath.line(to: NSPoint(x: 11.97, y: 31.25))
        outlinePath.line(to: NSPoint(x: 11.97, y: 83.25))
        outlinePath.close()
        NSGraphicsContext.saveGraphicsState()
        context.setShadow(offset: NSSize(width: shadow.shadowOffset.width * resizedShadowScale, height: shadow.shadowOffset.height * resizedShadowScale), blur: shadow.shadowBlurRadius * resizedShadowScale, color: shadow.shadowColor!.cgColor)
        NSColor.black.setStroke()
        outlinePath.lineWidth = 2
        outlinePath.lineCapStyle = .round
        outlinePath.lineJoinStyle = .round
        outlinePath.stroke()
        NSGraphicsContext.restoreGraphicsState()
        
        NSGraphicsContext.restoreGraphicsState()

    }

